elements.expression:
shape "square" fill="#212121" border="rgba(255,255,255,0)" borderWidth=0 maintainAspect=false
| render css=".canvasRenderEl{
border-left: solid #0088A7 8px
}"

filters
| essql 
  query="SELECT count(*) as c FROM \"endgame-*\" WHERE event.kind = 'alert' AND endgame.event_subtype_full != 'diagnostic_event'"
| math "c"
| metric "Total Alerts" 
  metricFont={font family="'Open Sans', Helvetica, Arial, sans-serif" size=48 align="center" color="#FFFFFF" weight="normal" underline=false italic=false} 
  labelFont={font family="'Open Sans', Helvetica, Arial, sans-serif" size=14 align="center" color="#FFFFFF" weight="normal" underline=false italic=false}
| render containerStyle={containerStyle}

filters
| demodata
| markdown "ALERTS OVER TIME" 
  font={font family="'Open Sans', Helvetica, Arial, sans-serif" size=12 align="left" color="#BBBBBB" weight="bold" underline=false italic=false}
| render 
  css=".canvasRenderEl{
letter-spacing: 1px;
border-bottom: 0.5px solid #d0d0d0;
}"

